/*!/wp-content/themes/bail-bonds/js/scripts.js*/
(function ($) {


    /* ------------------------------------------------------------
    MAIN MENU DROPDOWNS
    ------------------------------------------------------------ */

    $(window).on('load resize', function (e) {

        var menumain = $("#menu_main, #menu_top").supersubs({
            minWidth: 14, // minimum width of sub-menus in em units
            maxWidth: 20, // maximum width of sub-menus in em units
            extraWidth: 1 // extra width can ensure lines don't sometimes turn over
            // due to slight rounding differences and font-family
        }).superfish({
            delay: 1, // one second delay on mouseout
            animation: {height: 'show'}, // fade-in and slide-down animation
            speed: 'fast', // faster animation speed
            autoArrows: false, // disable generation of arrow mark-up
            dropShadows: false
        });

        width = $(window).outerWidth(true);

        if (width > 750) {
            menumain.superfish();
        } else {
            menumain.superfish('destroy');
        }
    });


    /* ------------------------------------------------------------
        MOBILE MENU
    ------------------------------------------------------------ */
    $('.open').click(function () {
        $('#wrapper_site').toggleClass('active');
    });


    /* ----------------------------------------------------
    SLIDESHOWS
    ---------------------------------------------------- */

    $('#slideshow').slick({
        slidesToShow: 1,
        slidesToScroll: 1,
        arrows: true,
        autoplay: true,
        autoplaySpeed: 6000,
        speed: 750,
        dots: true,
        draggable: true,
        mobileFirst: true,
        pauseOnHover: false
    });
    /*
        $('#defendant_location').autocomplete({
          source: "/wp-content/themes/bail-bonds/includes/location-suggest.php",
          minLength: 4,
          select: function( event, ui ) {
            log( ui.item ?
              "Selected: " + ui.item.value + " aka " + ui.item.id :
              "Nothing selected, input was " + this.value );
          }
        });
        */


    $('#submit-btn-wrapper').click(function () {
        $('#submit-btn-wrapper').hide();
        $('#submit-btn-loader').show();
    });


    // Electronic Consent check...
    $('#elecConsent').click(function () {
        if ($(this).is(':checked')) {
            $('#elecConsentSubmit').prop('disabled', false);
        } else {
            $('#elecConsentSubmit').prop('disabled', true);
        }
    });


})(jQuery);
